import React from "react";

class UserSignUpPage extends React.Component{
    render(){
        return(
            <form>
                <div>
                    <h1>Sign Up Page</h1>
                </div>
                <div>
                    <h1>UserName</h1>
                    <input />
                </div>
                <div>
                    <h1>Password</h1>
                    <input type="password"/>
                </div>
            </form>
        );
    }
}

export default UserSignUpPage;
